// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DataTokenization {
    struct Dataset {
        string name;
        string description;
        uint256 price;
        address owner;
        bytes32 encryptedHash;
        uint256 expiryTime;
        bool isForSale;
        mapping(address => bool) authorizedUsers;
        address[] accessHistory;
    }

    mapping(uint256 => Dataset) public datasets;
    uint256 public datasetCount;

    // Mapeamento de saldos das contas
    mapping(address => uint256) public balances;

    event TokenPurchase(uint256 indexed datasetId, address indexed buyer, uint256 timestamp);
    event TokenTransfer(uint256 indexed datasetId, address indexed from, address indexed to, uint256 timestamp);
    event AccessBought(address indexed buyer, uint256 indexed datasetId, uint256 pricePaid);
    event BalanceUpdated(address indexed user, uint256 newBalance);

    // Adiciona um novo conjunto de dados ao sistema
    function registerDataset(
        string memory _name, 
        string memory _description, 
        uint256 _price, 
        bytes32 _encryptedHash,
        uint256 _expiryTime
    ) public {
        datasetCount++;
        Dataset storage newDataset = datasets[datasetCount];
        newDataset.name = _name;
        newDataset.description = _description;
        newDataset.price = _price;
        newDataset.owner = msg.sender;
        newDataset.encryptedHash = _encryptedHash;
        newDataset.expiryTime = block.timestamp + _expiryTime;
        newDataset.isForSale = true;
    }


    // Compra o acesso ao conjunto de dados
    // Compra o acesso ao conjunto de dados
    function buyAccess(uint256 datasetId, uint256 pricePaid) public payable {
        Dataset storage dataset = datasets[datasetId];

        // Verificar se o dataset está à venda
        require(dataset.isForSale, "Este dataset nao esta a venda.");

        // Adicionar verificação de valores para debug
        emit LogDebugValues(msg.value, dataset.price); // Adicionar um evento para verificar os valores

        // Verificar se o valor enviado corresponde ao preço do dataset
        require(msg.value == dataset.price, "Valor incorreto para compra.");

        // Verificar se o comprador tem saldo suficiente
        require(balances[msg.sender] >= pricePaid, "Saldo insuficiente para comprar.");

        // Deduzir o valor do saldo do comprador
        balances[msg.sender] -= pricePaid;

        // Conceder acesso ao comprador
        dataset.authorizedUsers[msg.sender] = true;
        dataset.accessHistory.push(msg.sender);

        // Transferir o pagamento ao proprietário original
        payable(dataset.owner).transfer(pricePaid);

        // Emitir evento de compra de acesso
        emit TokenPurchase(datasetId, msg.sender, block.timestamp);
        emit AccessBought(msg.sender, datasetId, pricePaid);
    }

    event LogDebugValues(uint256 msgValue, uint256 datasetPrice);



    // Verifica se o usuário possui acesso ao conjunto de dados e se o acesso ainda é válido
    function hasAccess(uint256 _datasetId) public view returns (bool) {
        Dataset storage dataset = datasets[_datasetId];
        return dataset.authorizedUsers[msg.sender] && block.timestamp <= dataset.expiryTime;
    }

    // Função para adicionar saldo à conta de um usuário
    function addBalance(address user, uint256 amount) public {
        require(msg.sender == owner(), "Somente o dono pode adicionar saldo.");
        balances[user] += amount;
        emit BalanceUpdated(user, balances[user]);
    }

    // Função para retornar o dono do contrato
    function owner() public view returns (address) {
        return msg.sender;
    }
}

